	class CustomDvar
	{
	public:
		dvar_s* _dvar{};

		void Register(dvar_s* dVar)
		{
			_dvar = dVar;
			T6SDK::ConsoleLog::LogTagged(T6SDK::ConsoleLog::C_DEBUG, false, "DVARS", "Registered dvar %s, at address 0x%X", _dvar->dvarName, (int)_dvar);
		}
		CustomDvar(dvar_s* dVar)
		{
			Register(dVar);
		}
		CustomDvar()
		{

		}


		void SetInt(int value)
		{
			_dvar->current.integer = value;
		}

		int GetInt() const
		{
			return _dvar->current.integer;
		}

		void SetFloat(float value)
		{
			_dvar->current.value = value;
		}

		float GetFloat() const
		{
			return _dvar->current.value;
		}

		void SetString(const char* value)
		{
			_dvar->current.string = value;
		}

		const char* GetString() const
		{
			return _dvar->current.string;
		}
		void SetBool(bool value)
		{
			_dvar->current.enabled = value;
		}

		bool GetBool() const
		{
			return _dvar->current.enabled;
		}
		void SetVec3(float x, float y, float z)
		{
			_dvar->current.vector[0] = x;
			_dvar->current.vector[1] = y;
			_dvar->current.vector[2] = z;
		}

		float* GetVec3() const
		{
			return _dvar->current.vector;
		}

		void SetEnum(int value)
		{
			_dvar->current.value = value;
		}

		int GetEnum() const
		{
			return _dvar->current.value;
		}

		void Reset()
		{
			_dvar->current = _dvar->reset;
		}

		bool Modified()
		{
			return _dvar->modified;
		}
		void ClearModified()
		{
			_dvar->modified = false;
		}
		bool IsChanged() const
		{
			return _dvar->current.value != _dvar->reset.value || _dvar->current.integer != _dvar->reset.integer || _dvar->current.enabled != _dvar->reset.enabled || _dvar->current.string != _dvar->reset.string || _dvar->current.vector[0] != _dvar->reset.vector[0] || _dvar->current.vector[1] != _dvar->reset.vector[1] || _dvar->current.vector[2] != _dvar->reset.vector[2];
		}
	};

